import React from 'react';
import Card from './Card';
import './App.css';

function App() {
  const products = [
    {
      title: 'Product 1',
      price: '₹1000',
      details: 'Some details about Product 1',
      addOns: [
        { name: 'Addon 1', price: 100 },
        { name: 'Addon 2', price: 150 },
      ],
    },
    {
      title: 'Product 2',
      price: '₹1500',
      details: 'Some details about Product 2',
      addOns: [
        { name: 'Addon 1', price: 100 },
        { name: 'Addon 2', price: 200 },
      ],
    },
    // Add more products as needed
  ];

  return (
    <div className="App">
      {products.map((product, index) => (
        <Card 
          key={index} 
          title={product.title} 
          price={product.price} 
          details={product.details} 
          addOns={product.addOns} 
        />
      ))}
    </div>
  );
}

export default App;
